            <div>
              <p>
                <img src="Comments Image" alt="Comments"/>
                <img src="Tweet Image" alt="Re Tweet"/>  
                <img src="message Image" alt="like"/> 
              </p>
            </div>           
          </div>
          ))
      }


    </div>

    <div class="card">
      <h3>You might like</h3>
      <div class="fakeimg"><p><img src={props.image}/>     {props.name}<br/>{props.tweetid}</p></div>
      <div class="fakeimg"><p>Image</p></div>
      <div class="fakeimg"><p>Image</p></div>
    </div>
    <div class="card">
      <h3>Trends for you</h3>
